// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract ContactManager {
    address public owner;

    struct Contact {
        string name;
        address contactAddress;
    }

    mapping(address => Contact) public contactsByAddress;
    mapping(uint256 => address) public contactsByNumber;
    uint256 public contactCount;

    event NewContactAdded(string name, address contactAddress);

    constructor() {
        owner = msg.sender;
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Only the owner can call this function");
        _;
    }

    function addContact(string memory _name, address _contactAddress) external onlyOwner {
        Contact storage newContact = contactsByAddress[_contactAddress];
        newContact.name = _name;
        newContact.contactAddress = _contactAddress;

        contactsByNumber[contactCount] = _contactAddress;
        contactCount++;

        emit NewContactAdded(_name, _contactAddress);
    }

    function getContactByNumber(uint256 contactNumber) external view returns (string memory, address) {
        address contactAddress = contactsByNumber[contactNumber];
        Contact memory contact = contactsByAddress[contactAddress];
        return (contact.name, contact.contactAddress);
    }

    function getContactByAddress(address contactAddress) external view returns (string memory, uint256) {
        Contact memory contact = contactsByAddress[contactAddress];
        uint256 contactNumber = findContactNumber(contactAddress);
        return (contact.name, contactNumber);
    }

    function findContactNumber(address contactAddress) internal view returns (uint256) {
        for (uint256 i = 0; i < contactCount; i++) {
            if (contactsByNumber[i] == contactAddress) {
                return i;
            }
        }
        revert("Contact not found");
    }
}

